import React from 'react';
import './App.css';

import { Component } from 'react';
import Header from './Component/Header';
import Body from './Component/Body';

class App extends Component {
  render() {
    return (
      <div className="App">

        <Header />
        <Body />

      </div>
    );
  }
}

export default App;
